--  DDL for View DAT_USSD_MENU_IMSI_CODE_VW
--------------------------------------------------------

  CREATE OR REPLACE FORCE EDITIONABLE VIEW "DAT_USSD_MENU_IMSI_CODE_VW" ("ID", "USSD_CODE", "USSD_IMSI_PREFIX", "STATUS", "MENU_KEY", "TEXT_VAR_1", "TEXT_VAR_2", "TEXT_VAR_3", "TEXT_VAR_4", "MENU_NEXT_ID", "MENU_ACTION", "MENU_CONDITION", "MENU_PARAMETER", "MENU_IS_CHOICE", "MENU_SESSION_END", "SECURE_MENU", "FTU", "PRE_PROCESSING_INFO", "POST_PROCESSING_INFO") AS 
  select m.id, c.ussd_code, i.ussd_imsi_prefix, m.status, m.menu_key, m.text_var_1, m.text_var_2, m.text_var_3, m.text_var_4, m.menu_next_id, m.menu_action, m.menu_condition, m.menu_parameter, m.menu_is_choice, m.menu_session_end, m.SECURE_MENU, m.FTU, m.PRE_PROCESSING_INFO, m.POST_PROCESSING_INFO
from dat_ussd_menus m, dat_ussd_code_imsi ci, dat_ussd_codes c, dat_ussd_imsi_ranges i
where m.ussd_code_imsi = ci.id
and ci.ussd_code = c.id
and ci.ussd_imsi_range = i.id
and m.status = 1
order by m.id asc;
